Заявление президента Еврокомиссии Урсулы фон дер Ляйен:

▪️ЕС никогда не примет тезис РФ о том, что Украина не имеет права на существование, на кону ее судьба, но и судьба ЕС также;

▪️Будет активизирован механизм защиты беженцев, разрешен доступ к европейским школам, больницам и системе обеспечения;

▪️Санкции: перечислила те, что уже были приняты (заморозка активов ЦБ РФ, запрет на поставки технологий и т.д.), «но не ошибайтесь: мы заморозим и их яхты, и автомобили»;

▪️Останавливают лицензии «пропагандистской машины Кремля» - каналов Russia Today и Sputnik, а также дочерних структур;

▪️Отказ от российских энергоносителей («мы не можем полагаться на поставщика, что нам угрожает») ускорит переход на «зеленую» энергетику;

▪️Украине уже предоставили 500 млн евро военной помощи, теперь ЕС выделит еще 500 млн для помощи беженцам;

▪️Евроинтеграция Украины: «Сегодня ЕС и Украина ближе, чем когда-либо. Еще предстоит пройти долгое время, завершить войну, после - говорить о следующих шагах. Но никто не сомневается в том, что люди, которые так храбро встали на защиту своей страны, не могут оставаться вне европейской семьи».

🇺🇦 Выступление завершила, сказав по-украински «Слава Украине!»

Утренняя сводка от Минобороны

Свинособаки потеряли:
▪️5 российских истребителей под Васильковом и Броварами (2 сбили летчики, 3 - ракетные дивизионы С-200);
▪️1 крылатую ракета и 1 вертолет под Киевом;
▪️бронетехнику и живую силу на Киевщине и Житомирщине;
▪️танк и два зенитро-ракетных комплекса "БУК" (поработал Bayraktar TB2).

А также враг получил четыре сокрушительных бомбовых удара по танковым колоннам, колоннам механизированной техники, автоколонне с горюче-смазочными материалами на Черниговщине и близ Бердянска.

Міністр закордонних справ Британії Британія про нові санкції: 

▪️ Заморозка активів ще трьох російських банків - ВЕБ, "Совкомбанку" і банку "Открытие»;

▪️ Російські гіганти, такі як "Газпром", більше не зможуть випускати боргові зобов'язання або акції в Лондоні; 

▪️ Заборона експорту до Росії з Британії в ряді "критичних секторів". Це включає високотехнологічне обладнання, таке як мікроелектроніка, морське та навігаційне обладнання;

▪️ В планах домогтись відсторонення Росії від Інтерполу.

Брифинг советника главы офиса Зеленского Михаила Подоляка после переговоров: 

Российская и украинская делегация поедут в свои столицы для консультаций перед новым раундом переговоров;

Стороны определили ряд приоритетных тем, по которым наметились определенные решения;

Основной целью переговоров сегодня было обсуждение прекращения огня в Украине.

За минули добу західні партнери надали таку допомогу Україні:

⚡️ЄС – летальна зброя на суму 450 млн євро;

⚡️Норвегія – 230 млн доларів гуманітарної допомоги;

⚡️Італія – 110 млн євро;

⚡️Австралія – летальна військова
допомога;

⚡️Бельгія – 3 тисячі автоматичних гвинтівок та 200 одиниць протитанкової зброї;

⚡️Німеччина – протитанкова зброя та 500 зенітних ракет Stinger;

⚡️Чехія – зброя та техніка на суму 18 млн доларів;

⚡️Швеція – 5 тисяч одиниць протитанкової зброї. 

#світзнами

Контакт-центр Міністерства охорони здоровʼя 0800602019 приймає дзвінки та запити щодо критичних потреб:

– від медичних закладів — у лікарських засобах, виробах медичного призначення, у кисні, бронежилетах для екстреної допомоги чи інших потребах для термінового реагування;

– від громадян — щодо проблемних питань із забезпеченням інсулінами чи іншими лікарськими засобами в аптечних закладах.

Головне з виступу президента:

— хуйло позначив його та його сім'ю «ціллю номер один»;
— Україну в НАТО брати бояться;
— э інформація, що до Києва вже зайшли російські диверсійні групи;
— у перший день російської атаки загинули 137 українських військових, 316 поранені.

❗️Подробности по мобилизации:

- мобилизация проводится во всех областях Украины кроме Луганской и Донецкой;
- срок проведения: в течение 90 суток со дня вступления в силу настоящего Указа;
- призыв военнообязанных, резервистов и т.д. осуществляется в объемах, определенных согласно мобилизационным планам;
- главам областных государственных администраций поручено обеспечить создание и работу областных, районных и городских медицинских комиссий.

❗️Чрезвычайное положение, по словам Данилова, в Украине предусматривает:

— усиление охраны общественного порядка;
— проверки документов у граждан;
— ограничение движения транспорта и его осмотр.

⚡️СНБО Украины принято решение о введении ЧП на всей территории Украины, кроме Донецкой и Луганской областей, решение должна утвердить Верховная рада на протяжении 48 часов. 

Кроме того, в ообластях Украины, граничащих с РФ и Беларусью вводятся дополнительные временные режимные ограничения, сообщает Госпогранслужба Украины.

Запрещается:
— пребывание на пограничной территории в ночное время;
— выход на любых плавсредствах из пунктов базирования;
— передвижение транспорта (кроме военного, силовых структур, агротехники) по дорогам, которые отсутствуют в реестре автодорог и ведут к госгранице.

⚡️Хуйло окончательно ебанулся. Он заявил о 4 шагах к нормализации отношений с Украиной:

— признать аннексию Крыма;
— отказаться от вступления в НАТО;
— решить вопрос Донбасса на переговорах;
— демилитаризация Украины.

